package Inheritance;

public class SwitchStatment {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int value=4;
		switch(value) {
		case 3: System.out.println("print case 3 executed");
		break;
		case 2: System.out.println("print case 2 executed");
		break; 
		case 8: System.out.println("print case 8 executed");
		break;
		default:System.out.println("soory match does not found");
		}

	}

}
